import React, {useState, useEffect} from 'react';
import axios from 'axios';

function Home() {
    const url = 'https://iot.fvh.fi/opendata/uiras/uiras-meta.json'
    const [product, setProduct] = useState(null)

    axios.get(url)
        .then(response => {
            setProduct(response.data)
        })

    return(
        <div>
            <h1 className = "font-bold text-xl text-left p-5">Beaches near you</h1> 
        </div>
    )
}

export default Home
